import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import isEqual from "lodash.isequal";

import ManagerTable from "../ManagerTable";

const companyColumns = [
  {
    Header: "Name",
    accessor: "company",
  },
  {
    Header: "Address",
    accessor: "address",
  },
  {
    Header: "Address2",
    accessor: "address2",
  },
  {
    Header: "Website",
    accessor: "website_url",
  },
  {
    Header: "City",
    accessor: "company_city",
  },
  //   {
  //     Header: "",
  //     accessor: "id",
  //     Cell: ({ value }) => <Link to={`/EditCompany/${value}`}>Manage</Link>,
  //     disableSortBy: true,
  //  },
];

const Companies = ({
  companies,
  setCompanies,
  staff,
  api,
  companiesDetailed,
  setCompaniesDetailed,
}) => {
  let table;

  table = (
    <ManagerTable
      columns={companyColumns}
      data={companiesDetailed}
    ></ManagerTable>
  );

  return <div className="container">{table}</div>;
};

export default Companies;
